import React, { useState, useEffect } from 'react';
import './../customer/css/DashboardPage.css'; // Add custom styles
import Notification from './../../Notification'; // Import the Notification component
import Navbar from '../../components/Navbar';

function DashboardPage() {
  const [transactions, setTransactions] = useState([]);
  const [newTransaction, setNewTransaction] = useState({
    amount: '',
    currency: '',
    provider: 'SWIFT',
    accountNumber: '',
    swiftCode: '',
  });
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');
  const [isModalOpen, setIsModalOpen] = useState(false); // Track if the modal is open

  // Fetch transaction history (mock data or real API call)
  useEffect(() => {
    // For mock data, you can use this instead of fetching from an API:
    const mockTransactions = [
      { id: 1, amount: '1000', currency: 'USD', provider: 'SWIFT', status: 'Pending' },
      { id: 2, amount: '500', currency: 'EUR', provider: 'SWIFT', status: 'Completed' },
    ];
    setTransactions(mockTransactions);
  }, []);

  // Handle input changes for new transaction form
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setNewTransaction(prev => ({
      ...prev,
      [name]: value,
    }));
  };

  // Handle form submission for new payment
  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      // Mocking the API call for submitting the transaction
      setTransactions([newTransaction, ...transactions]);
      setSuccess('Transaction submitted successfully');
      setIsModalOpen(false); // Close modal after submission
      setNewTransaction({
        amount: '',
        currency: '',
        provider: 'SWIFT',
        accountNumber: '',
        swiftCode: '',
      });
    } catch (err) {
      console.error(err);
      setError('Something went wrong.');
    }
  };

  // Open the modal to add a new transaction
  const openModal = () => {
    setIsModalOpen(true);
  };

  // Close the modal
  const closeModal = () => {
    setIsModalOpen(false);
  };

  return (
    <>
      <Navbar userType="Customer" />
      <div className="dashboard-container">
        <h2>Customer Dashboard</h2>

        {/* Display Success or Error Notifications */}
        {success && <Notification message={success} type="success" />}
        {error && <Notification message={error} type="error" />}

        {/* Transaction History */}
        <h3>Transaction History</h3>
        <table>
          <thead>
            <tr>
              <th>Amount</th>
              <th>Currency</th>
              <th>Provider</th>
              <th>Status</th>
            </tr>
          </thead>
          <tbody>
            {transactions.map((transaction) => (
              <tr key={transaction.id}>
                <td>{transaction.amount}</td>
                <td>{transaction.currency}</td>
                <td>{transaction.provider}</td>
                <td>{transaction.status}</td>
              </tr>
            ))}
          </tbody>
        </table>

        {/* Button to open modal for new transaction */}
        <button onClick={openModal}>Initiate a New Payment</button>

        {/* Modal for adding new payment */}
        {isModalOpen && (
          <div className="modal-overlay">
            <div className="modal-content">
              <h3>Initiate New Payment</h3>
              <form onSubmit={handleSubmit}>
                <label>Amount</label>
                <input
                  type="number"
                  name="amount"
                  value={newTransaction.amount}
                  onChange={handleInputChange}
                  required
                />
                <label>Currency</label>
                <input
                  type="text"
                  name="currency"
                  value={newTransaction.currency}
                  onChange={handleInputChange}
                  required
                />
                <label>Account Number</label>
                <input
                  type="text"
                  name="accountNumber"
                  value={newTransaction.accountNumber}
                  onChange={handleInputChange}
                  required
                />
                <label>SWIFT Code</label>
                <input
                  type="text"
                  name="swiftCode"
                  value={newTransaction.swiftCode}
                  onChange={handleInputChange}
                  required
                />
                <button type="submit">Submit</button>
                <button type="button" onClick={closeModal}>Cancel</button>
              </form>
            </div>
          </div>
        )}
      </div>
    </>
  );
}

export default DashboardPage;
